  let { listSeat } = props;
  console.log(listSeat);
  function renderListSeat() {
    for (let i = 1; i <= row; i++) {
      arrSeat.push(<ListSeat key={i + "key"} row={i} listSeat={listSeat} />);
    }
    return arrSeat;
  }
  return (
    <div className="listSeat">
      <div className="autoCenter"></div>
    </div>
  );
}

